        # 0 <= i <= j < n
        # dp[i, j] = (dp[i, j - 1], x - nums[j]) or  (dp[i + 1, j], x - nums[i])
        n = len(nums)
        if x < nums[0] and x < nums[-1] or x > sum(nums):
            return -1
        memo = {}
        def dfs(i, j, target):
            # target is the sum we want from 2 ends
            # memo store the min operation we need for nums[i...j] with target = target
            if target < 0 or target > sum(nums[i:j + 1]):
                return float('inf')
            if target == nums[i] or target == nums[j]:
                return 1
            if i == j:
                if nums[i] == target:
                    return 1
                return float('inf')

            if (i, j, target) in memo:
                return memo[(i, j, target)]
            
            tmp1, tmp2 = dfs(i, j - 1, target - nums[j]), dfs(i + 1, j, target - nums[i])
            ans = min(tmp1, tmp2) + 1
            # print(i, j, target, ans)
            memo[(i, j, target)] = ans
            return ans

        
        res = dfs(0, n - 1, x)
        if res == float('inf'):
            return -1
        else:
            return res


